//https://developer.mozilla.org/fr/docs/Web/JavaScript/Reference/Global_Objects/parseInt
filterInt = function (value) {
    if (/^(-|\+)?(\d+|Infinity)$/.test(value))
        return Number(value);
    return NaN;
}


class toolbox {
    static sortNumberArray(a, b) {
        return a - b;
    };
    
    static parseLevelsFloat(str) {
        let result = null;

        //Level values separated by ';'
        let regex1 = /^-?\d+(?:\.\d+)?(?:;-?\d+(?:\.\d+)?)*$/;//1;3;5;8

        //Level values separated by ','
        let regex2 = /^-?\d+(?:\.\d+)?(?:,-?\d+(?:\.\d+)?)*$/;

        if (regex1.test(str)) {
            result = (str + '').split(';');
            for (let i = 0; i < result.length; i++) {
                result[i] = parseFloat(result[i]);
            }
            result.sort(toolbox.sortNumberArray);
        } else if (regex2.test(str)) {
            result = str.split(',');
            for (let i = 0; i < result.length; i++) {
                result[i] = parseFloat(result[i]);
            }
            result.sort(toolbox.sortNumberArray);
        }
        //Level intervals
        else {
            let regexResult = null;
            let min = null;
            let max = null;

            //Level values (only integers) in an interval, bounded with '-'
            let regex3 = /^(-?\d+)-(-?\d+)$/;

            //Level values from start to end (example: "-3 to 2")
            let regex4 = /^(?:\w+ )?(-?\d+) to (-?\d+)$/;

            if (regex3.test(str)) {
                regexResult = regex3.exec(str);
                min = parseInt(regexResult[1]);
                max = parseInt(regexResult[2]);
            } else if (regex4.test(str)) {
                regexResult = regex4.exec(str);
                min = parseInt(regexResult[1]);
                max = parseInt(regexResult[2]);
            }

            //Add values between min and max
            if (regexResult != null && min != null && max != null) {
                result = [];
                if (min > max) {
                    var tmp = min;
                    min = max;
                    max = tmp;
                }

                //Add intermediate values
                for (var i = min; i != max; i = i + ((max - min) / Math.abs(max - min))) {
                    result.push(i);
                }
                result.push(max);
            }
        }
        // if (result === null){
        //     let regexxd = /^(-?\d+)-(-?\d+);-?\d+(?:\.\d+)?(?:;-?\d+(?:\.\d+)?)*$/;
        //     console.log(regexxd.exec(str));
        // }


        return result;
    };
};


