for (let feat_ of building.features.filter(feat__ =>
        feat__.properties.level !== undefined &&
        feat__.geometry !== undefined &&
        (feat__.geometry.type === "MultiPolygon" ||
        feat__.geometry.type === "Polygon") //&&
        // feat__.properties.level === "" + level && (
        // (feat__.properties.indoor === "room" ||
        // feat__.properties.indoor === "area" ||
        // feat__.properties.indoor === "corridor" ||
        // feat__.properties.indoor === "yes")
    )) {
    //level
    // console.log(feat_);
    let levels = toolbox.parseLevelsFloat(feat_.properties.level);
    if (levels !== null) {
        for(let i = 0;i < levels.length;++i ){
            let l = levels[i];
            if (! isNaN(l)) {
                if (! unions.hasOwnProperty(l)) {
                    unions[l] = turf.polygon([]);
                }
                try {
                    unions[l] = turf.union(unions[l],feat_);
                } catch (error) {
                    console.error('Erreur de turf.union',error);
                    // Note - error messages will vary depending on browser
                }
            }
        }
    } else {
        console.log("level bizarre",feat_.properties.level,levels);
    }
    //repeat_on
    if (feat_.properties.repeat_on !== undefined){
        levels = toolbox.parseLevelsFloat(feat_.properties.repeat_on);
        console.log("repeat",feat_.properties.repeat_on,levels);
        if (levels !== null) {
            for(let i = 0;i < levels.length;++i ){
                let l = levels[i];
                if (! isNaN(l)) {
                    if (! unions.hasOwnProperty(l)) {
                        unions[l] = turf.polygon([]);
                    }
                    try {
                        unions[l] = turf.union(unions[l],feat_);
                    } catch (error) {
                        console.error('Erreur de turf.union',error);
                        // Note - error messages will vary depending on browser
                    }
                }
            }
        }
    }
}


